import "./SinglePost.css";
const SinglePost = () => {
  return (
    <>
      <div className="singlePost">
        <div className="singlePost-wrapper">
          <img className="singlePost-wrapper-img" src="" alt="singlePostImg" />
          <h1 className="singlePost-title">Lorem ipsum dolor sit amet.</h1>
        </div>
      </div>
    </>
  );
};
export default SinglePost;
